bot2.on("messageCreate", (msg) => {
	if (msg.author.bot2) return;
	let command = msg.content.split(" ")[0];
    let args = msg.content.split(" ").slice(1);

    if (command === "/avatar" && args[0] != null){
    	bot2.editSelf({avatar: `data:image/png;base64,`});
    }
    if(command === "/connections"){
    	console.log(bot2.getSelfConnections());
    }
    if(command == bot2.user.mention && msg.author.id != '211962239433834498'){
    	bot2.createMessage(msg.channel.id, msg.author.mention + ' *he heee*');
    }else if(command == bot2.user.mention && msg.author.id == '211962239433834498'){
    	bot2.createMessage(msg.channel.id, msg.author.mention + ' Uari uari uoquen');
    }
});
